        <p class="tc mb4 measure center">
          {{ $t('people.life_event_blank', { name: contactName }) }}
        </p>
        <div class="tc">
          <a class="mb4 btn" href="" @click.prevent="showAdd = true">
            {{ $t('people.life_event_list_cta') }}
          </a>
        </div>
      </div>
    </section>

    <!-- TITLE -->
    <div v-else>
      <h3 class="mb3 relative">
        🎭 {{ $t('people.life_event_list_title') }}

        <span class="absolute" style="top: -5px; right: 0;">
          <a v-if="showAdd" class="btn edit-information" href="" @click.prevent="showAdd = false">
            {{ $t('app.cancel') }}
          </a>
          <a v-else class="btn edit-information" href="" @click.prevent="showAdd = true">
            {{ $t('people.life_event_list_cta') }}
          </a>
        </span>
      </h3>
    </div>

    <!-- CREATE LIFE EVENT BOX -->
    <create-life-event v-if="showAdd"
                       :hash="hash"
                       :months="months"
                       :days="days"
                       :years="years"
                       @updateLifeEventTimeline="updateLifeEventsList($event)"
                       @dismissModal="showAdd = false"
    />

    <!-- LISTING OF LIFE EVENTS -->
    <div v-if="lifeEvents.length != 0">
      <div class="bt b--gray-monica" style="margin-left: 20px;">
        <div v-for="lifeEvent in lifeEvents" :key="lifeEvent.id">
          <div :id="'lifeEvent' + lifeEvent.id" class="bl bb b--gray-monica bg-hover-monica relative pa3 life-event-list-content">
            <div class="absolute life-event-list-icon">
              <img class="relative" :src="'img/people/life-events/types/' + lifeEvent.default_life_event_type_key + '.svg'" :alt="lifeEvent.default_life_event_type_key" />
            </div>
            <div class="absolute life-event-list-actions f7">
              <span>{{ lifeEvent.happened_at }}</span>
              <span></span>
            </div>
            <p class="pt2">
              <span class="b">
                {{ $t('people.life_event_sentence_' + lifeEvent.default_life_event_type_key) }}
              </span> {{ lifeEvent.name }}
            </p>
            <p>{{ lifeEvent.note }}</p>
            <p class="f7">
              <a class="pointer" href="" @click.prevent="showDeleteModal(lifeEvent)">
                {{ $t('app.delete') }}
              </a>
            </p>
          </div>
        </div>
      </div>
    </div>

    <!-- Delete confirmation modal -->
    <sweet-modal ref="deleteLifeEventModal" overlay-theme="dark" :title="$t('people.life_event_delete_title')">
      <form>
        <div class="mb4">
          <p class="mb2">
            {{ $t('people.life_event_delete_description') }}
          </p>
        </div>
      </form>
      <div slot="button">
        <a class="btn center" href="" @click.prevent="closeDeleteModal()">
          {{ $t('app.cancel') }}
        </a>
        <a v-cy-name="'delete-life-event-button'" class="btn btn-primary" href="" @click.prevent="destroy(lifeEventToDelete)">
          {{ $t('app.delete') }}
        </a>
      </div>
    </sweet-modal>
  </div>
</template>

<script>
import { SweetModal } from 'sweet-modal-vue';

export default {

  components: {
    SweetModal
  },

  props: {
    hash: {
      type: String,
      default: '',
    },
    years: {
      type: Array,
      default: function () {
        return [];
      }
    },
    months: {
      type: Array,
      default: function () {
        return [];
      }
    },
    days: {
      type: Array,
      default: function () {
        return [];
      }
    },
    contactName: {
      type: String,
      default: '',
    },
  },

  data() {
    return {
      lifeEvents: [],
      lifeEventToDelete: null,
      showAdd: false,
    };
  },

  mounted() {
    this.prepareComponent();
  },

  methods: {
    prepareComponent() {
      this.getLifeEvents();
    },

    getLifeEvents() {
      axios.get('people/' + this.hash + '/lifeevents')
        .then(response => {
          this.showAdd = false;
          this.lifeEvents = response.data;
        });
    },

    /**
          * @TODO: do not refresh the list from the server, simply add
          * the new object to the collection
          */
    updateLifeEventsList(updatedLifeEvent) {
      this.getLifeEvents();
      window.location.href='people/' + this.hash + '#lifeEvent'  + updatedLifeEvent.id;
    },

    destroy(lifeEvent) {
      axios.delete('lifeevents/' + lifeEvent.id)
        .then(response => {
          this.closeDeleteModal();
          this.getLifeEvents();

          this.$notify({
            group: 'main',
            title: this.$t('people.life_event_delete_success'),
            text: '',
            type: 'success'
          });
        });
    },

    showDeleteModal(lifeEvent) {
      this.$refs.deleteLifeEventModal.open();
      this.lifeEventToDelete = lifeEvent;
    },

    closeDeleteModal() {
      this.$refs.deleteLifeEventModal.close();
    },
  }
};
</script>
